import React from "react";
import {add,minus,mult,div} from "./Calc"

function App() {
    return(<>
        <h1>the sum is {add(4,3)} </h1>
        <h1>the minus is {minus(2,3)} </h1>
        <h1>the mult is {mult(2,3)} </h1>
        <h1>the div is {div(2,3)} </h1>
        </>);

}
export default App;
